import React from "react";
import { Container, Row, Carousel, Navbar } from "react-bootstrap";

function Header() {
  return (
    <div>
      <Navbar bg="dark" variant="dark" sticky="top" expand="md" collapsOnSelect>
        <Navbar.Brand href="/">GR0</Navbar.Brand>
        <Navbar.Toggle />
        <Navbar.Collapse>
          <Nav>
            <Nav.Link href="product-description">
              {" "}
              Product Description{" "}
            </Nav.Link>
            <Nav.Link href="cold-email"> Cold Email Generator </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
}

export default Header;
